% %
% %      result = c & ~applylut(c,lutskel[i]);
% %
% %   This function was written as an optimization to the BWMORPH
% %   skeletonization algorithm, which was previously doing an APPLYLUT
% %   operation followed by some additional steps.  These additional steps
% %   were folded into a (new) look-up table.  The new look-up tables were
% %   generated with this function.
% %
% %   HINT: When using this function and pasting the result into a file,
% %   try this:
% %
% %      clip(makenewskellut(3));
