% % skel2 = lutskel2;
% % skel3 = lutskel3;
% % skel4 = lutskel4;
% % skel5 = lutskel5;
% % skel6 = lutskel6;
% % skel7 = lutskel7;
% % skel8 = lutskel8;
% % 
% % c = a;
% % c = c & ~applylut(c, skel1);
