% % c = c & ~applylut(c, skel4);
% % c = c & ~applylut(c, skel5);
% % c = c & ~applylut(c, skel6);
% % c = c & ~applylut(c, skel7);
% % c = c & ~applylut(c, skel8);
% 
% 
% % Here we use makelut to create a new look-up table that does the &, the ~,
